import React from 'react';



export default function TaskList(props) {
  const {tasks} = props;


  // JSX
  return (
    <div id="tasklist-container">
      {tasks.length < 1 ? 
        <p>No tasks at this moment...</p> 
        : 
        tasks.map((task, id) => <p key={id}>ID: {task.id}, TITLE: {task.title}, DETAILS: {task.details}</p>)}
    </div>
  );
}
